    public static boolean isWall(int y, int x) {
//        System.out.println("map1: " + map[0].length + " " + map.length + " ");
//        System.out.println("map2: " + map2[0].length + " " + map2.length + " ");
//        System.out.println("map3: " + map3[0].length + " " + map3.length + " ");
//        System.out.println("map4: " + map4[0].length + " " + map4.length + " ");

//        map1: 61 45
//        map2: 86 45
//        map3: 60 43
//        map4: 87 43

        if (x >= 0 && x <= 60 && y >= 0 && y <= 44) {
            return map[y][x] == 1 || map[y][x] == 2;
        } else if (x > 60 && x <= 148 && y >= 0 && y <= 44) {
            return map2[y][x - 61] == 1 || map2[y][x - 61] == 2;
        } else if (x >= 0 && x <= 60 && y >= 45 && y <= 87) {
            return map3[y - 45][x] == 1 || map3[y - 45][x] == 2;
        } else if (x > 60 && x <= 148 && y >= 45 && y <= 87) {
            return map4[y - 45][x   - 61] == 1 || map4[y - 45][x   - 61] == 2;

        }

        return false;

    }

