    public static boolean isAirSystem(int y, int x) {
        if (x >= 0 && x <= 60 && y >= 0 && y <= 44) {
            if (map[y][x] == 3) {
                System.out.println("DefaultMap.java Air System: y: " + y + " x: " + x);
                return true;
            }
        } else if (x > 60 && x <= 148 && y >= 0 && y <= 44) {
            if(map2[y][x - 61] == 3) {
                System.out.println("DefaultMap.java Air System: y: " + y + " x: " + x);
                return true;
            }
        } else if (x >= 0 && x <= 60 && y >= 45 && y <= 87) {
            if(map3[y - 45][x] == 3) {
                System.out.println("DefaultMap.java Air System: y: " + y + " x: " + x);
                return true;
            }
        } else if (x > 60 && x <= 148 && y >= 45 && y <= 87) {
            if(map4[y - 45][x - 61] == 3) {
                System.out.println("DefaultMap.java Air System: y: " + y + " x: " + x);
                return true;
            }
        }
        return false;
    }
